EthIR (Ethereal IR) is an intermediate representation developed specifically for our translator. It serves several key purposes: Tracking the stack state to identify jump destinations. Duplicating blocks that are reachable from predecessors with different stack states. Reconstructing the complete control-flow graph of the contract using the aforementioned data. Resolving dependencies and static data chunks. Meaning of EthIR data: V_<name> - a value returned by an instruction. T_<tag> - the tag of an assembly block. 40 - a hexadecimal constant. tests/solidity/simple/default.sol:Test - a contract full path definition. Stack legend format: [ <current_1> | <current_2> | ... | <current_N> ] - [ <popped_1> | <popped_2> | ... | <popped_N> ] + [ <pushed_1> | <pushed_2> | ... | <pushed_N> ]. // The default entry function of the contract.
function main {
// The maximum stack size in the function. stack_usage: 6
block_dt_0/0: // Deploy Code Tag 0, Instance 0.
// PUSHed 0x80 onto the stack. PUSH 80 [ ] + [ 80 ]
// PUSHed 0x40 onto the stack. PUSH 40 [ 80 ] + [ 40 ]
// POPped 0x40 at 0x80 from the stack to store 0x80 at 0x40. MSTORE [ ] - [ 80 | 40 ]
// PUSHed CALLVALUE onto the stack. CALLVALUE [ ] + [ V_CALLVALUE ] DUP1 [ V_CALLVALUE ] + [ V_CALLVALUE ] ISZERO [ V_CALLVALUE ] - [ V_CALLVALUE ] + [ V_ISZERO ] PUSH [tag] 1 [ V_CALLVALUE | V_ISZERO ] + [ T_1 ]
// JUMPI schedules rt_0/0 for analysis with the current stack state. JUMPI [ V_CALLVALUE ] - [ V_ISZERO | T_1 ] PUSH 0 [ V_CALLVALUE ] + [ 0 ] DUP1 [ V_CALLVALUE | 0 ] + [ 0 ] REVERT [ V_CALLVALUE ] - [ 0 | 0 ]
