This type of exception is inherited from the EVM architecture. In EVM, instructions like REVERT and INVALID immediately terminate the contract’s execution and return control to the callee. It is impossible to catch them within the contract; only the callee can detect them by checking the call status code. // callee
revert(0, 0) // caller
let success = call(...)
if iszero(success) { // option 1: rethrow on the contract level returndatacopy(...) revert(...) // option 2: rethrow on the function level verbatim("throw") // only available in the Yul mode
} EraVM’s behavior is fully equivalent: the VM unwinds the call stack all the way to the contract’s top-level function frame, leaving no possibility to intercept or handle the exception along the way. These types of exceptions are more efficient, as you can revert at any point of the execution without propagating the exception all the way up.

